var vResetPassword=new Vue({el:"#login",data:{messages:[],password:"",repeatPassword:""},computed:{isValid:function(){return!this.errors.any()&&""!=this.password&&""!=this.repeatPassword}},methods:{onSubmit:function(){if(!this.errors.any()){var s={Authorization:"JWT "+localStorage.getItem("token")},e={password:this.password,repeatPassword:this.repeatPassword};this.$http.post("/api/auth/reset-password",e,{headers:s}).then(function(s){console.log(s);var e=s.body.token;e?(localStorage.setItem("token",e),document.location.href="/home"):this.messages.push({type:"error",message:"Username, password or code incorrect"})},function(s){404==s.status?this.messages.push({type:"error",message:"Page Not Found: "+s.url}):this.messages.push({type:"error",message:s.body.message})})}}}});